objetoCompra:
Aquisição de Sacos Plásticos para Acondicionamento de Resíduos para uso Administrativo e Industrial para realização de coleta seletiva, conforme legislação ambiental vigente e PGRS – Plano de Gerenciamento de Resíduos Sólidos aprovado pela FEPAM e SMAMUS para a CEITEC.
	Sacos de 20 litros (0,05 micra ou suportar até 6kg);
	Sacos de 60 litros (0,10 micras ou suportar até 10kg);
	Sacos de 100 litros (0,10 micras ou suportar até 30kg).

informacaoComplementar:
Serviço de monitoramento hidroquímico da água subterrânea para a execução de 04 (quatro) campanhas semestrais (2 anos), conforme ANEXO II - Especificação Técnica elaborada pela DPIMA/EB, incluindo:

- Mobilização e Desmobilização de Pessoal e Equipamentos;

- Levantamento Topográfico;

- Coleta de amostras de água subterrânea em 11 poços (10 de monitoramento + 1 de abastecimento), utilizando método de baixa vazão, conforme ABNT NBR 15847;

- Análises laboratoriais químicas de água com os parâmetros: 
Replicata - água
BTEX – água; 
HPA – água; e 
TPH Fingerprint.

- Manutenção dos poços, incluindo fornecimento e instalação de tampa da câmara de calçada; tampa (cap) de pressão (2” ou 4”), cadeados, placas de identificação e recomposição de calçadas, quando necessário;

- Elaboração de Relatório Técnico completo com ART, conforme modelo “padrão de relatório” conforme ANEXO II - Especificação Técnica elaborada pela DPIMA/EB.

Observação:
Todos os preços unitários estão apresentados conforme Planilha de Preços Unitários (PPU) – Anexo IV. 
A soma total da Planilha de Preços Unitários corresponde ao valor global da proposta registrada no sistema, sendo este o valor válido para fins de adjudicação, contratação e emissão de nota de empenho. DISPENSA DIRETA DEPOIS DA PUBLICAÇÃO DO AVISO DE CONTRATAÇÃO DIRETA Nº 90021/2025 (FRACASSADO)
